package com.ufgov.zc.server.zc.service.impl;import java.util.List;import com.ufgov.zc.common.system.dto.ElementConditionDto;import com.ufgov.zc.common.zc.model.DataExchange;import com.ufgov.zc.common.zc.model.DataExchangeLog;import com.ufgov.zc.common.zc.model.DataExchangeRedo;import com.ufgov.zc.server.zc.dao.IDataExchangeDao;import com.ufgov.zc.server.zc.service.IDataExchangeService;public class DataExchangeService implements IDataExchangeService {  private IDataExchangeDao dataExchangeDao;  public List getDataExchangeLogs(ElementConditionDto dto) {    return dataExchangeDao.getDataExchangeLogs(dto);  }  public DataExchangeLog save(DataExchangeLog log) {    return dataExchangeDao.save(log);  }  public List getAllDataExchange() {    return dataExchangeDao.getAllDataExchange();  }  public IDataExchangeDao getDataExchangeDao() {    return dataExchangeDao;  }  public void setDataExchangeDao(IDataExchangeDao dataExchangeDao) {    this.dataExchangeDao = dataExchangeDao;  }  public List getDataExchangeRedos(ElementConditionDto dto) {    return this.dataExchangeDao.getDataExchangeRedos(dto);  }  public void saveRedo(DataExchangeRedo redo) {    this.dataExchangeDao.saveRedo(redo);  }  public DataExchange save(DataExchange de) {    return this.dataExchangeDao.save(de);  }  public void updateDataExchangeRedoIsExported(DataExchangeRedo redo) {    this.dataExchangeDao.updateDataExchangeRedoIsExported(redo);  }  public List getDataExchangeRedosByLikeRecordID(ElementConditionDto redoDto) {    return this.dataExchangeDao.getDataExchangeRedosByLikeRecordID(redoDto);  }}